INSERT INTO `sites` (`id`, `url`, `title`, `description`, `keyword`, `clicks`) VALUES
(1, 'https://www.bbc.co.uk', 'BBC - Home', 'The best of the BBC, with the latest news and sport headlines, weather, TV & radio highlights and much more from across the whole of BBC Online', '', 0),
(2, 'https://www.bbc.co.uk/accessibility/', 'BBC - My Web My Way - Home', 'My Web My Way explains the many ways you can change your browser, computer, keyboard and mouse settings to make the web more accessible to you', '', 0),
(3, 'https://account.bbc.com/account', 'BBC â Sign in', '', '', 0),
(4, 'https://www.bbc.co.uk/news', 'Home - BBC News', 'Visit BBC News for up-to-the-minute news, breaking news, video, audio and feature stories. BBC News provides trusted World and UK news as well as local and regional perspectives. Also entertainment, business, science, technology and health news.', '', 0),
(5, 'https://www.bbc.co.uk/sport', 'Home - BBC Sport', 'Breaking news & live sports coverage including results, video, audio and analysis on Football, F1, Cricket, Rugby Union, Rugby League, Golf, Tennis and all the main world sports, plus major events such as the Olympic Games.', '', 0),
(6, 'https://www.bbc.co.uk/weather', 'BBC Weather', 'Latest weather conditions and forecasts for the UK and the world. Includes up to 14-days of hourly forecast information, warnings, maps, and the latest editorial analysis and videos from the BBC Weather Centre.', '', 0),
(7, 'https://www.bbc.co.uk/iplayer', 'BBC iPlayer', 'Watch live BBC TV channels, enjoy TV programmes you missed and view exclusive content on BBC iPlayer.', '', 0),
(8, 'https://www.bbc.co.uk/sounds', 'BBC Sounds - Music. Radio. Podcasts', 'Listen without limits, with BBC Sounds. Catch the latest music tracks, discover binge-worthy podcasts, or listen to radio shows – all whenever you want.', '', 0),
(9, 'https://www.bbc.co.uk/cbbc', 'The Official Home of CBBC - CBBC - BBC', 'Welcome to CBBC. Here you can play free online kids games, watch your favourite shows, chat with celebrities and join in with the fun.', '', 0),
(10, 'https://www.bbc.co.uk/cbeebies', 'Games for kids and early years activities - CBeebies - BBC', 'CBeebies helps pre-schoolers learn whilst they play fun games, watch clips, sing songs and make things with their favourite CBeebies characters and shows.', '', 0),
(11, 'https://www.bbc.co.uk/food', 'BBC Food - Recipes and inspiration from your favourite BBC programmes and chefs', 'Find recipes from your favourite BBC programmes and chefs, or browse by ingredient or dish. With over 13000 recipes you\'re sure to find the perfect dish.', '', 0),
(12, 'https://www.bbc.co.uk/bitesize', 'Home - BBC Bitesize', 'Use BBC Bitesize to help with your homework, revision and learning. Find free videos, step-by-step guides, activities and quizzes by level and subject.', '', 0),
(13, 'https://www.bbc.co.uk/arts', 'Culture in Quarantine - BBC Arts', 'The homepage for Arts on the BBC, with film, features and events showcasing the arts in the UK and beyond.', '', 0),
(14, 'https://www.bbc.co.uk/taster', 'BBC Taster', 'Taster is the home of new ideas from the BBC', '', 0),
(15, 'https://www.bbc.co.uk/news/localnews', 'Local News - BBC News', 'Get the latest news in your local area from BBC News.', '', 0),
(16, 'https://www.bbc.co.uk/bbcthree', 'BBC Three | Docs, Comedies, Videos & Articles', 'All the latest documentaries, comedy, videos, articles and more from the award winning digital channel, BBC Three. Makes you think. Makes you laugh', '', 0),
(17, 'https://search.bbc.co.uk/search', 'BBC - Search', 'Search the BBC', '', 0),
(18, 'http://www.bbc.com/news/world-us-canada-53507660', 'Trump to send \'surge\' of hundreds of federal agents to cities - BBC News', 'Talking tough on crime with an election looming, Mr Trump vows to end the \"bloodshed\".', '', 0),
(19, 'http://www.bbc.com/news/world/us_and_canada', 'US & Canada - BBC News', 'Get the latest American and Canadian news from BBC News in the US and Canada: breaking news, features and analysis plus audio and video content from North America.', '', 0),
(20, 'http://www.bbc.com/news/science-environment-53504797', 'China\'s Tianwen-1 Mars rover rockets away from Earth - BBC News', 'The Asian country\'s first surface mission to the Red Planet heads out on a Long March 5 rocket.', '', 0),
(21, 'http://www.bbc.com/news/science_and_environment', 'Science & Environment - BBC News', 'Get the latest BBC Science and Environment News: breaking news, analysis and debate on science and nature in the UK and around the world.', '', 0),
(22, 'http://www.bbc.com/news/live/world-53509270', 'Coronavirus: Basic income for world\'s poorest \'could slow virus\' - BBC News', 'A UN Development Programme report says the fund would allow 2.7 billion people to stay at home.', '', 0),
(23, 'http://www.bbc.com/news/world', 'World - BBC News', 'Get the latest BBC World News: international news, features and analysis from Africa, the Asia-Pacific, Europe, Latin America, the Middle East, South Asia, and the United States and Canada.', '', 0),
(24, 'https://www.bbc.com/travel/story/20200722-britains-newly-discovered-ancient-sites', 'BBC - Travel - Britain’s newly discovered ancient sites', 'Lidar technology has revealed a whole new timeline of human occupation across the UK, from prehistoric burial mounds to hidden Roman roads to medieval farmsteads.', '', 0),
(25, 'http://www.bbc.com/travel', 'BBC - Travel - Home', '', '', 0),
(26, 'https://www.bbc.com/culture/article/20200722-eerily-prescient-2020-plague-novels', 'Eerily prescient 2020 plague novels - BBC Culture', 'How did three of this year’s fictional works end up being so connected to today’s crisis? Caryn James takes a look.', '', 0),
(27, 'http://www.bbc.com/culture', 'Home - BBC Culture', 'Covering the latest in global arts and culture in all its forms, BBC Culture gives an international view of film and TV, books, art, music and style.', '', 0),
(28, 'http://www.bbc.com/news', 'Home - BBC News', 'Visit BBC News for up-to-the-minute news, breaking news, video, audio and feature stories. BBC News provides trusted World and UK news as well as local and regional perspectives. Also entertainment, business, science, technology and health news.', '', 0),
(29, 'http://www.bbc.com/news/world-us-canada-53510260', 'China-US row: Fugitive researcher \'hiding in San Francisco consulate\' - BBC News', 'The researcher lied about her military background, the FBI says, amid a row over Chinese consulates.', '', 0),
(30, 'http://www.bbc.com/news/world-asia-india-53445010', 'India\'s diamond-studded response to the virus - BBC News', 'Jewelers have been inspired by the pandemic to turn every day masks into something precious.', '', 0),
(31, 'http://www.bbc.com/news/world/asia/india', 'India - BBC News', 'Get the latest Asian news from BBC News in Asia: breaking news, features, analysis and special reports plus audio and video from across the Asian continent.', '', 0),
(32, 'http://www.bbc.com/news/technology-53510574', 'Twitter says hackers viewed 36 accounts\' private messages - BBC News', 'The social network said that one of those affected was a Dutch elected official.', '', 0),
(33, 'http://www.bbc.com/news/technology', 'Technology - BBC News', 'Get the latest BBC Technology News: breaking news and analysis on computing, the web, blogs, games, gadgets, social media, broadband and more.', '', 0),
