(123, 'https://play.google.com/store/movies/details/The_Legend_of_Baron_To_a?id=2avoAPYfh28.P', 'The Legend of Baron To\'a - Movies on Google Play', 'When his late father\'s priceless championship belt is stolen by a ruthless gang, a displaced Tongan man must reconnect with his father\'s legacy to defeat the barbaric gang kingpin and get the title back. The directorial debut from Kiel McNaughton sees an all-star Pasifika and Maori cast, including Uli Latukefu (Alien: Covenant, Marco Polo), Nathaniel Lees (The Matrix Reloaded), Jay Laga\'aia (Star Wars), John Tui (Battleship, Hobbs and Shaw), Shortland Street alumni Shavaughn Ruakere and Fasitua Amosa (Auckl', '', 0),
(124, 'https://play.google.com/store/movies/details/Hell_on_the_Border?id=nkJMGJokDiw.P', 'Hell on the Border - Movies on Google Play', 'This epic, action-packed Western tells the incredible true story Bass Reeves (David Gyasi), the first black U.S. Marshal in the Wild West. Having escaped from slavery after the Civil War, Reeves arrives in Arkansas seeking a job with the law. To prove himself, he must hunt down a deadly outlaw (Frank Grillo) with the help of a grizzled journeyman (Ron Perlman). As he chases the criminal deeper into the Cherokee Nation, Reeves must dodge bullets and severe discrimination in hopes of earning his star - and en', '', 0),
(125, 'https://play.google.com/store/movies/details/Abigail?id=pEb7yFAspY4.P', 'Abigail - Movies on Google Play', 'A young girl Abigail lives in a city whose borders were closed many years ago because of an epidemic of a mysterious disease. Abby\'s father was one of the sick - and he was taken when she was six years old. Going against the authorities to find her father, Abby learns that her city is full of magic. And she discovers in herself extraordinary magical abilities.', '', 0),
(126, 'https://play.google.com/store/movies/details/A_Night_of_Horror_Nightmare_Radio?id=7V-Q5INLYsM.P', 'A Night of Horror: Nightmare Radio - Movies on Google Play', 'On a stormy night Rod leads a radio show dedicated to horror. Listeners call to the radio telling their own paranormal stories. Until suddenly the announcer begins to receive strange calls from a child who desperately asks for help. At first Rod thinks that it is a bad joke until he discovers that this is not the case... Not only that. These calls hide a dark secret in which the announcer himself will be involved...', '', 0),
(127, 'https://play.google.com/store/movies/details/Bloodline?id=WjddUmJUn24.P', 'Bloodline - Movies on Google Play', 'From the producers of \'Us\' and \'Get Out\' an ultra-violent thriller in the vein of \'Dexter.\' Evan (Seann William Scott) values family above all else, and anyone who gets between him, his wife, and newborn son learns that the hard way. But when it comes to violent tendencies, it seems the apple doesn\'t fall far from the tree.', '', 0),
(128, 'https://play.google.com/store/movies/details/A_Good_Woman_Is_Hard_to_Find?id=Wioi9EBzn2o.P', 'A Good Woman Is Hard to Find - Movies on Google Play', 'A terrific showcase performance from star Sarah Bolger anchors this film that critics have hailed as a ânerve-rattling suspense thriller (Flickering Myth)â. With its finger firmly on the pulses of stark social commentary and shattering suspense, A Good Woman Is Hard To Find is a dark and daring journey through Northern Irelandâs criminal underbelly, as one woman tries to protect her family while uncovering the truth behind her husbandâs murder.', '', 0),
(129, 'https://play.google.com/store/movies/details/Time_Shifters?id=HWPnffusBzE.P', 'Time Shifters - Movies on Google Play', 'Sensing something amiss on their college campius, a group of students go on a quest where they must survive unknnown forces to find answers. Battling Guards, Griefers and at times each other ,they\'ll have to fight make it out alive!', '', 0),
(130, 'https://play.google.com/store/movies/details/Superhuman_The_Invisible_Made_Visible?id=EX7BpW0iHy4.P', 'Superhuman: The Invisible Made Visible - Movies on Google Play', 'Award-winning \"Superhuman: The Invisible Made Visible\" is based on the jaw-dropping experiences of individuals with extra-sensory powers that seem to defy the laws of physics known to man today. Producer and host Caroline Cory, who has her own extensive experience in the field of Consciousness Science and Extra Sensory Perception, takes the viewers on an extraordinary journey to achieve tangible and measurable proof of these seemingly miraculous phenomena. Through a series of groundbreaking scientific exper', '', 0),
(131, 'https://play.google.com/store/movies/category/7', 'Documentary - Movies on Google Play', 'Enjoy millions of the latest Android apps, games, music, movies, TV, books, magazines & more. Anytime, anywhere, across your devices.', '', 0),
(132, 'https://play.google.com/store/movies/details/Enemy_Lines?id=xEOxALM5kC8.P', 'Enemy Lines - Movies on Google Play', 'November 1943. A crack British commando squad is teamed with an American officer on a covert mission deep behind enemy lines into frozen, war-torn Poland. Working with the resistance, they cross the harsh wilderness, intent on kidnapping and extracting a sought-after Polish scientist from the Germans.', '', 0),
(133, 'https://play.google.com/store/movies/collection/cluster?clp=mgMECAYYAg%3D%3D:S:ANO1ljKVKc0&gsr=CgeaAwQIBhgC:S:ANO1ljJ100I', 'Movies on Google Play', '', '', 0),
(134, 'https://play.google.com/store/movies/details/Louis_Theroux_My_Scientology_Movie?id=QB96-4s1et0', 'Louis Theroux: My Scientology Movie - Movies on Google Play', 'Incomparable British broadcaster Louis Theroux is hilariously provocative in his first feature documentary, LOUIS THEROUX: MY SCIENTOLOGY MOVIE, created in collaboration with director John Dower and two-time Academy Award winning producer Simon Chinn. Following a long fascination with the religion, and with a lot of experience dealing with eccentric human behaviour, Theroux won\'t take no for an answer when his request to enter the Church of Scientology\'s Los Angeles headquarters is turned down. Theroux\'s in', '', 0),
(135, 'https://play.google.com/store/movies/details/Exodus_Gods_and_Kings?id=hb75sql7YJs', 'Exodus: Gods and Kings - Movies on Google Play', 'From acclaimed director Ridley Scott (Gladiator, Prometheus) comes the epic adventure EXODUS, the story of one manâs daring courage to take on the might of an empire. Using state of the art visual effects and 3D immersion, Scott brings new life to the story of the defiant leader Moses (Christian Bale) as he rises up against the Egyptian Pharoah Ramses (Joel Edgerton), setting 600,000 slaves on a monumental journey of escape from Egypt and its terrifying cycle of deadly plagues.', '', 0),
(136, 'https://play.google.com/store/movies/details/Tomb_Raider?id=Lyr-0MdFibU', 'Tomb Raider - Movies on Google Play', 'Lara Croft is the fiercely independent daughter of an eccentric adventurer, lost to her when she was barely a teen. Now 21 and struggling to make her way in the world, Lara is determined to forge her own path rather than take the reins of her father\'s global empire...so even she can\'t understand what drives her to solve the puzzle of his mysterious death. Going explicitly against her dad\'s final wishes, Lara leaves the familiar streets of London in search of a mythical island -- which may or may not exist -', '', 0),
(137, 'https://play.google.com/store/movies/details/Vampire_Academy?id=-A1B6TJhZVk', 'Vampire Academy - Movies on Google Play', 'In Vampire Academy Rose Hathaway develops a mental and spiritual bond with her BVFF (best vampire friend forever) Princess Lissa. The two girls attend a strict school for vampires designed to retain their humanity where it is Rose\'s task to protect the Princess. Among the everyday issues faced by teenage vampires Rose falls for Dimitri, their dreamy guardian, and together the three battle the mysterious forces of the evil Moroi who are set on destroying the Princess\'s bloodline.', '', 0),
(138, 'https://play.google.com/store/movies/details/Skyscraper?id=FSDyjjo0nqo', 'Skyscraper - Movies on Google Play', 'International superstar Dwayne Johnson (\"The Fate of the Furious,\" \"Central Intelligence\") stars in the 3D action-thriller \"Skyscraper,\" written and directed by Rawson Marshall Thurber (\"Central Intelligence,\" \"We\'re the Millers\"). Johnson plays former FBI Hostage Rescue Team leader and U.S. war veteran Will Ford, who now assesses security for skyscrapers. On assignment in China, he discovers that the world\'s tallest, safest building has been set on fire and he has been framed for it. Now, Will must find th', '', 0),
(139, 'https://play.google.com/store/movies/details/Ralph_Breaks_The_Internet_Subbed?id=Jy8quLfOccI', 'Ralph Breaks The Internet (Subbed) - Movies on Google Play', 'From Walt Disney Animation Studios comes the action-packed adventure Ralph Breaks the Internet. Ralph and fellow misfit Vanellope risk it all by traveling to the world wide web in search of a part to save her game, Sugar Rush. They\'re in way over their heads, so they must rely on the citizens of the internet-including Yesss, the head algorithm and heart and soul of the trend-making site BuzzzTube, and Shank, a tough-as-nails driver from the gritty online auto-racing game Slaughter Race-to help them navigate', '', 0),
(140, 'https://play.google.com/store/movies/details/Fifty_Shades_Darker?id=fx58dFMcOf4', 'Fifty Shades Darker - Movies on Google Play', 'In the second chapter of the \"Fifty Shades\" trilogy, innocent Anastasia continues her passionate love affair with the enigmatic billionaire Christian Grey. As Christian struggles with his inner demons, Anastasia faces the jealous anger of one of Christianâs former flames. Dakota Johnson and Jamie Dornan reprise their roles as Anastasia and Christian in this sexy sequel to the blockbuster phenomenon, \"Fifty Shades of Grey.\" James Foley directs from Niall Leonard\'s screenplay adaption of the best-selling bo', '', 0),
(141, 'https://play.google.com/store/movies/details/The_Faculty?id=0UP5TUAoxUo', 'The Faculty - Movies on Google Play', 'Like so many schools today, Herrington High has passed its prime. Its walls are grimy, its textbooks out-dated, its teachers burned out. There\'s no money for field trips, new computers or the drama department\'s musical. Yet its crumbling corridors vibrate with the future of America -- loners, leaders, hipsters, nerds, brains and jocks. Like teenagers everywhere, they struggle with parents who don\'t get it, teachers who never had it and hormones that won\'t quit. But the students of Herrington High are about ', '', 0),
(142, 'https://play.google.com/store/movies/details/Predestination?id=qups5RtN9No', 'Predestination - Movies on Google Play', 'PREDESTINATION chronicles the life of a Temporal Agent sent on an intricate series of time-travel journeys designed to ensure the continuation of his law enforcement career for all eternity. Now, on his final assignment, the Agent must pursue the one criminal that has eluded him throughout time. Â© Pinnacle Films 2012 (Original Title: Predestination)', '', 0),
(143, 'https://play.google.com/store/movies/details/Romeo_Juliet?id=sHEjxTF5Cm0', 'Romeo + Juliet - Movies on Google Play', 'Directed by Academy Award nominee Baz Luhrman (Moulin Rouge), this adaption of the classic Shakespearean play is passionate, visceral, sexy, violent, and other-worldly. Set in the mythical city of Verona Beach, the Montague\'s and Capulet\'s are two feuding families whose children meet and fall in love. Romeo (Leonardo DiCaprio) and Juliet (Claire Danes) must hide their love from the world... but with tragic consequences.', '', 0),
