(184, 'https://servicesdirectory.withyoutube.com/', 'YouTube Creator Services Directory', 'Explore YouTube\'s resources and search for companies that can help grow your business.', '', 0),
(185, 'https://www.youtube.com/nextup', 'NextUp | YouTube', 'Learn to create better videos, get more subscribers and take your channel to the next level with the YouTube NextUp contest. Winners get access to a weeklong Creator Camp at YouTube Spaces and other awesome prizes.', '', 0),
(186, 'https://www.youtube.com/space/', 'YouTube Space', 'YouTube Space provides you creative inspiration, a place to make your next video, and opportunities to collaborate with creators and artists in the local community.', '', 0),
(187, 'https://vr.youtube.com/', 'YouTube VR - Home - YouTube VR', 'YouTube is the home of immersive content', '', 0),
(188, 'https://www.youtube.com/creators-for-change/', 'Creators for Change | YouTube', 'A global initiative that supports creators like you – creators who are tackling social issues and promoting awareness, tolerance and empathy on their YouTube channels. Because no matter what kind of videos we make, we all have the power to help create the world we want.', '', 0),
(189, 'https://youtube.com/csai-match/', 'YouTube CSAI Match', 'The YouTube CSAI Match site is an online destination to learn more about how to protect your site and business against child exploitation videos.', '', 0),
(190, 'https://socialimpact.youtube.com/', 'Home | YouTube Social Impact', 'Our mission is to harness YouTube’s scale, technology and talent to ignite and sustain movements that drive measurable social change.', '', 0),
(191, 'https://www.youtube.com', 'YouTube', 'Enjoy the videos and music you love, upload original content and share it all with friends, family and the world on YouTube.', '', 0),
(192, 'https://www.youtube.com/t/terms', '  Terms of Service - YouTube', 'Enjoy the videos and music you love, upload original content and share it all with friends, family and the world on YouTube.', '', 0),
(193, 'https://www.youtube.com/howyoutubeworks/our-commitments/managing-harmful-content/', 'How YouTube manages harmful content - How YouTube Works', 'We use automated systems and human detection to aid in content removal that violates YouTube policies. Learn more about YouTube Community Guidelines.', '', 0),
(194, 'https://www.youtube.com/howyoutubeworks/our-commitments/standing-up-to-hate/', 'How YouTube protects the community from hate and harassment - How YouTube Works', 'There is no place for hate speech and harassment on YouTube. We remove policy violative content. Review our guidelines today.', '', 0),
(195, 'https://www.youtube.com/howyoutubeworks/our-commitments/fighting-misinformation/', 'YouTube Misinformation - How YouTube Works', 'YouTube’s systems help review hundreds of thousands of hours of videos every day in order to find and limit the spread of harmful misinformation.', '', 0),
(196, 'https://www.youtube.com/howyoutubeworks/our-commitments/curbing-extremist-content/', 'How YouTube prevents radicalization - How YouTube Works', 'Our policies limit the reach of violent and extreme content on YouTube. Any content designed to incite violence or hatred is against our policies.', '', 0),
(197, 'https://www.youtube.com/howyoutubeworks/our-commitments/supporting-elections/', 'How YouTube supports elections - How YouTube Works', 'With users looking to YouTube for election information, we have a responsibility to provide a secure experience to support informed citizens.', '', 0),
(198, 'https://www.youtube.com/howyoutubeworks/our-commitments/preventing-bias/', 'How YouTube Prevents Bias - How YouTube Works', 'YouTube enforces policies in a neutral way. Our platform has always been about sharing information everywhere and giving many different people a voice.', '', 0),
(199, 'https://www.youtube.com/howyoutubeworks/our-commitments/fostering-child-safety/', 'How YouTube Keeps Kids Safe - How YouTube Works', 'We created YouTube Kids as a way for kids to safely explore their interests and curiosity while providing parents tools to control the experience.', '', 0),
(200, 'https://www.youtube.com/howyoutubeworks/our-commitments/protecting-user-data/', 'How YouTube Protects Data Privacy - How YouTube Works', 'We take our approach to privacy seriously. We work hard to protect your information and put you in control by providing powerful privacy settings.', '', 0),
(201, 'https://www.youtube.com/howyoutubeworks/our-commitments/safeguarding-copyright/', 'How YouTube Prevents Content Piracy - How YouTube Works', 'The majority of media uploaded to YouTube does not infringe anyone’s copyright. Nevertheless, we\'ve invested in tools designed to prevent video piracy.', '', 0),
(202, 'https://www.youtube.com/howyoutubeworks/our-commitments/sharing-revenue/', 'How YouTube Makes Money - How YouTube Works', 'YouTube\'s main source of revenue is advertising. Creators and YouTube share revenue generated from these channels. Learn more about YouTube revenue.', '', 0),
(203, 'https://www.youtube.com/howyoutubeworks/our-commitments/promoting-digital-wellbeing/', 'How YouTube supports digital wellbeing - How YouTube Works', 'We believe YouTube technology should improve life, not distract from it, so we’re committed to giving you resources you need for digital wellbeing.', '', 0),
(204, 'https://www.youtube.com/howyoutubeworks/our-commitments/covid-response/', 'Youtube Response During Coronavirus - How YouTube Works', 'Discover how YouTube has responded to coronavirus with policies, resources, and products to protect the YouTube community from misinformation.', '', 0),
(205, 'https://www.youtube.com/howyoutubeworks/product-features/search/', 'YouTube Search - How YouTube Works', 'With over 500 hours of video uploaded every minute, finding what you need would be nearly impossible without help. Discover how to use YouTube Search.', '', 0),
(206, 'https://www.youtube.com/howyoutubeworks/product-features/recommendations/', 'YouTube Video Recommendations - How YouTube Works', 'YouTube video Recommendations help you discover more of the videos you love. We share recommendations and suggestions of what videos to watch next.', '', 0),
(207, 'https://www.youtube.com/howyoutubeworks/product-features/news-information/', 'YouTube Authoritative News & Information - How YouTube Works', 'When it comes to YouTube news and information, we know that authoritativeness is key. That’s why we help users easily discover trustworthy sources.', '', 0),
(208, 'https://www.youtube.com/howyoutubeworks/product-features/monetization/', 'How YouTube Creators Earn Money - How YouTube Works', 'YouTube Creators who are a part of the YouTube Partner Program, can earn money on the platform. Learn more about YouTube creator monetization sources.', '', 0),
(209, 'https://www.youtube.com/howyoutubeworks/product-features/live/', 'How to Live Stream On YouTube - How YouTube Works', 'YouTube live streaming allows you to reach your community in real time. Discover how to go live on YouTube from webcam, mobile, and encoder streaming.', '', 0),
(210, 'https://www.youtube.com/howyoutubeworks/user-settings/privacy/', 'YouTube Privacy Controls & Settings - How YouTube Works', 'When you use YouTube, you’re trusting us with your information. We understand this is a big responsibility. Review our Privacy Controls today.', '', 0),
(211, 'https://www.youtube.com/howyoutubeworks/user-settings/ad-settings/', 'YouTube Ad Preferences & Settings - How YouTube Works', 'With YouTube Ad Settings you can choose your ad preferences and which information you want to be used for personalizing your ads.', '', 0),
(212, 'https://www.youtube.com/howyoutubeworks/user-settings/parental-controls/', 'YouTube Kids Parental Controls - How YouTube Works', 'We built YouTube Kids as a safer environment for kids to explore, while giving parents controls in the app to customize their kids’ experience.', '', 0),
(213, 'https://www.youtube.com/howyoutubeworks/user-settings/autoplay/', 'YouTube Autoplay Feature - How YouTube Works', 'The Autoplay feature on YouTube keeps videos playing without you having to select a new video when the video you’re watching finishes.', '', 0),
(214, 'https://www.youtube.com/howyoutubeworks/policies/overview/', 'YouTube Policies & Guidelines - How YouTube Works', 'Users around the world use YouTube to express ideas and opinions. That\'s why we have policies meant to preserve free expression and a safe community.', '', 0),
(215, 'https://www.youtube.com/howyoutubeworks/policies/community-guidelines/', 'YouTube Community Guidelines & Policies - How YouTube Works', 'Our Community Guidelines and policies apply to all YouTube content and define what you can and cannot do on YouTube.', '', 0),
(216, 'https://www.youtube.com/howyoutubeworks/policies/copyright/', 'YouTube Copyright & Fair Use Policies - How YouTube Works', 'Everyone has access to YouTube’s Copyright Management Tools, which gives rights holders control of their copyrighted material on YouTube.', '', 0),
(217, 'https://www.youtube.com/howyoutubeworks/policies/monetization-policies/', 'YouTube Monetization Policies - How YouTube Works', 'A key YouTube Partnership Program requirement is to follow monetization policies, which include Community Guidelines, Terms of Service, and more.', '', 0),
(218, 'https://www.youtube.com/howyoutubeworks/policies/legal-removals/', 'YouTube Legal Content Removals - How YouTube Works', 'While our policies apply everywhere, YouTube is available in more than 100 countries - so we also have a process in place to comply with local law.', '', 0),
(219, 'https://www.youtube.com/howyoutubeworks/progress-impact/responsibility/', 'YouTube Progress on Managing Harmful Content - How YouTube Works', 'A key part of our commitment to Responsibility is removing content that violates policies. Here are a few data points to show you how we’re doing.', '', 0),
(220, 'https://www.youtube.com/howyoutubeworks/progress-impact/impact/', 'YouTube Impact Stories - How YouTube Works', 'People all over the world are impacted by YouTube. Explore the stories behind just a few of YouTube’s creative entrepreneurs here.', '', 0),
