(1354, 'https://www.pet.co.nz/blog', 'Pet Advice Centre', 'Take good care of your pet with our Pet advice centre. Find information, tips and training guides for your dog, cat, bird, reptile, horse and many other adorable pets.', '', 0),
(1355, 'https://www.pet.co.nz/blog/view/357', 'Keep your dog cool this summer', ' Learn more on identifying the signs of heat stroke and how to keep your furry friend cool and safe this summer.', '', 0),
(1356, 'https://www.pet.co.nz/blog/view/196', 'How to keep your pet calm this Guy Fawkes', 'Chances are your pet will suffer from some degree of anxiety and fear at Guy Fawkes time. This is because sudden loud sharp noises coupled with bright flashes are all reasons for animals to be afraid and seek safety. This is how you can help your pet cope better this Guy Fawkes.', '', 0),
(1357, 'https://www.pet.co.nz/blog/view/356', 'Healthy dog treats are here from K9 Natural', 'A range of healthy new dog treats are now available thanks to our friends at K9 Natural. These tasty bites are high-quality and satisfaction, with none of the guilt – making them the ideal “responsible” treat. Find out what makes them so irresistible to pets here. ', '', 0),
(1358, 'https://www.pet.co.nz/blog/view/355', 'Could your cat be dehydrated? Feline Natural Hydration Boosters can help', 'Proper hydration is central to your cat’s health. Here are some that could indicated your cat is dehydrated, and how you can improve its water intake. Find out how to provide your cat with alternative sources of hydration. ', '', 0),
(1359, 'https://www.pet.co.nz/blog/view/42', 'How to treat and prevent worms in your pet', 'Worms are a common problem for cats and dogs – especially kittens and puppies. Find out the common signs of worms and how to prevent and treat your pet. ', '', 0),
(1360, 'https://www.pet.co.nz/blog/view/354', 'What to do if your pet has a sensitive stomach', 'Find out what you should do if your pet is suffering from upset stomach or something potentially worse.', '', 0),
(1361, 'https://www.pet.co.nz/blog/view/353', 'Healthy treats to reward your dog with', 'Giving your pet a treat is an effective training aid, a reward for good behaviour and a way to show them love and make them happy. In general, treating your pet is a healthy practice, but it should be just that: a treat. Find out how to select healthy treats for your dog. ', '', 0),
